To create or update a subscription with the Vic API, you can pass the following. curl --request PUT \ --url http://api.us.dev.vic.ai/subscription \ --header 'Authorization: Bearer MYBEARERTOKEN' \ --header 'Accept: application/json' \ --header 'Content-Type: application/json' \ --data '{ "callbackUrl": "https://yourCallbackUrl", "accessToken": "unique-token-per-client", "expiresAt": "2024-01-01T00:00:00Z"
}' If you wish to only subscribe to specific events you may pass an array of event names. curl --request PUT \ --url http://api.us.stage.vic.ai/subscription \ --header 'Authorization: Bearer MYBEARERTOKEN' \ --header 'Accept: application/json' \ --header 'Content-Type: application/json' \ --data '{ "callbackUrl": "https://yourCallbackUrl", "accessToken": "unique-token-per-client", "expiresAt": "2024-01-01T00:00:00Z", "events": ["payment_batch_processed"]
}' If you need to update your subscription to receive all events after trimming it down, you may pass "events":["all"]. When passing all, it must be set by itself. curl --request PUT \ --url http://api.us.stage.vic.ai/subscription \ --header 'Authorization: Bearer MYBEARERTOKEN' \ --header 'Accept: application/json' \ --header 'Content-Type: application/json' \ --data '{ "callbackUrl": "https://yourCallbackUrl", "accessToken": "unique-token-per-client", "expiresAt": "2024-01-01T00:00:00Z", "events": ["all"]
}'
